import React, { useState } from "react";
import "../../homepage/style/homeStyle.scss";
import BackHome from "./back";
import UserId from "./userInformation";
import ExpenseForm from "./expense";
import TripBuddyGroup from "./groupExpense";

const Home = () => {
    const [addExpense, setIsExpense] = useState(false);

    const handleAddExpense = () => {
        setIsExpense(true);
    };

    return (
        <>
            <div className="split-wise-wrapper">
                <BackHome />
                <div className="container">
                    <div className="header">
                        <UserId />
                    </div>
                    <div className="new-expense">
                        <TripBuddyGroup />
                        <button onClick={handleAddExpense}>settle</button>
                    </div>
                </div>
            </div>
            {addExpense && <ExpenseForm />}
        </>
    );
};

export default Home;
